import React from "react";
import FooterItem from "./FooterItem";

const Footer = (props) => {
  return (
    <div className="container">
      <div className="row">
        {props.footer.map((item, index) => {
          return (
            <div className="col-12 col-lg">
              <div>
                <FooterItem items={item.col_values} key={index} />
              </div>
            </div>
          );
        })}
      </div>
    </div>
  );
};

export default Footer;
